import React from "react";
import { useParams } from "react-router-dom";

const operacoesDetalhes = {
  "cri-ema": {
    cidade: "Barra dos Coqueiros",
    ifm: 0.769647,
    rgsd: 0.564435,
    garantias: 37828734.68,
    duration: 2.479945,
  },
  "cri-vanvera": {
    cidade: "Ariquemes",
    ifm: 2.541843,
    rgsd: 2.029735,
    garantias: 49716708.08,
    duration: 3.437875,
  },
};

const OperacaoDetalhes = () => {
  const { nome } = useParams();
  const dados = operacoesDetalhes[nome];

  return (
    <div className="operacao-container">
      <h2>{nome.toUpperCase()}</h2>
      {dados ? (
        <ul>
          <li><strong>Cidade:</strong> {dados.cidade}</li>
          <li><strong>IFM:</strong> {dados.ifm}</li>
          <li><strong>RGSD:</strong> {dados.rgsd}</li>
          <li><strong>Garantias:</strong> R$ {dados.garantias.toLocaleString("pt-BR")}</li>
          <li><strong>Duration:</strong> {dados.duration}</li>
        </ul>
      ) : (
        <p>Dados n√£o encontrados.</p>
      )}
    </div>
  );
};

export default OperacaoDetalhes;
